import React, { useEffect } from "react"
import axios from "axios"

const Status = () => {

  useEffect(()=>{
    axios.get("http://localhost:3000/status")
    .then(res => console.log(res.data)).catch(err => console.log())
  })

    return(
        <>
          <h1> from status section </h1>  
        </>
    )
}

export default Status
